import React from "react";

function sayHello() {
  console.log("Hello");
}

const Header = (prop) => {
  return <h1>{prop.text}</h1>;
};

class Button extends React.Component {
  render() {
    return <button onClick={sayHello}>{this.props.label}</button>
  }
}

class App extends React.Component {
  render() {
    return(
      <>
        <Header text="Hey you" />
        <Header text="You are super" /> 
        <Button label="Submit"/>
        <Button label="Cancel"/>
      </>
    )
  }
}

export default App;
